import React from 'react';
import './Home.css';


function Home() {
  return (
    <div className='home'>
      {/*Banner*/}
      <div className='home_banner'>
        <div className='home_bannerInfo'>
          <h1>Art is beautiful, Art is life,<br />Buy Arts</h1>
          <h2>Browse our collection to find the masterpiece that you desire or <br />Join us today to start selling</h2>
          <div className='home_bannerButtons'>
            <button>Explore Artworks</button>
            <button>Start Selling</button>
          </div>
        </div>
      </div>

      {/*Search*/}
      {/*Featured Artworks*/}
      {/*Top Artists*/}
      {/*Categories*/}
    </div>
  );
}

export default Home;
